import React,{useState} from "react";
import "../styles/Home.css";
import Destination from "./Destination";
const Home = () => {
    const [adultCounter, setadultCounter] = useState(1)
    const [childCounter, setchildCounter] = useState(0)
    const [infantCounter, setinfantCounter] = useState(0)
    const [tripValue, settripValue] = useState('Trip') 
    const [passCount, setPassCount] = useState(1)
    const [pclass, setPclass] = useState('Ecomony')
  return (
    <div>
        <form>
          <div className="f-q-container  d-flex">
            <Destination/>
            <div className="dropdown">
              <div className="trip-details dropdown-toggle" data-bs-toggle="dropdown" aria-expanded="false">
              {tripValue}</div>
              <div className="dropdown-menu">
                <div className="trip-item" onClick={()=> settripValue('One-way')}>One-way</div>
                <div className="trip-item" onClick={()=> settripValue('Return')}>Return</div>
              </div>
            </div>
            <div>
              <input type="date" id="departure" name="birthday"></input>
              <input type="date" id="arrival" name="birthday"></input>
            </div>
            <div className="pass-class-con">
              <div className="title">Passenger / Class</div>
              <div className="pc-displayvalue">{passCount},{pclass}</div>
              <div className="pass-detail-con">
                <div className="p-d-heading">Passenger</div>
                <div className="d-flex justify-content-between">
                  <div>Adult</div>
                  <div className="d-flex">
                    <div className="p-counter" onClick={() => {
                       if(passCount>1){
                        setadultCounter(adultCounter => adultCounter - 1)
                        setPassCount(passCount => adultCounter+childCounter+infantCounter-1)
                       }
                      }
                      } >-</div>
                    <div className="p-value p-a-value">{adultCounter}</div>
                    <div className="p-counter" onClick={() => {
                       if(passCount<9){
                        console.log(passCount)
                        setadultCounter(adultCounter => adultCounter + 1)
                        setPassCount(passCount => adultCounter+childCounter+infantCounter+1)
                       }
                      }
                      }>+</div>
                  </div>
                </div>
                <div className="d-flex justify-content-between">
                  <div>Child</div>
                  <div className="d-flex">
                    <div className="p-counter" onClick={() => {
                       if(passCount>=1 || passCount<=9){
                        setchildCounter(childCounter => childCounter - 1)
                        setPassCount(passCount => passCount+adultCounter+childCounter+infantCounter-1)
                       }
                      }
                      } >-</div>
                    <div className="p-value p-c-value">{childCounter}</div>
                    <div className="p-counter" onClick={() => {
                       if(passCount>=1 || passCount<=9){
                          setchildCounter(childCounter => childCounter + 1)
                          setPassCount(passCount => passCount+adultCounter+childCounter+infantCounter+1)
                       }
                      }
                      } >+</div>
                  </div>
                </div>
                <div className="d-flex justify-content-between mb-3">
                  <div >Infant</div>
                  <div className="d-flex">
                    <div className="p-counter" onClick={() => setinfantCounter(infantCounter => infantCounter - 1)}>-</div>
                    <div className="p-value p-i-value">{infantCounter}</div>
                    <div className="p-counter" onClick={() => setinfantCounter(infantCounter => infantCounter + 1)}>+</div>
                  </div>
                </div>
                <div className="sec-sep-line"></div>
                <div className="p-d-heading mt-2">Class</div>
                <div className="d-flex justify-content-between">
                  <label htmlFor="vehicle2">Economy</label>
                  <input type="radio" id="economy" name="class" value="economy"/>
                </div>
                <div className="d-flex justify-content-between">
                  <label htmlFor="vehicle3">Premieum</label>
                  <input type="radio" id="premeium" name="class" value="premeium"/>
                </div>
            </div>
            </div>
          </div>
        </form>
    </div>
  );
};

export default Home;
